#include "Zombie.hpp"

int main()
{
    std::string zombieName;
    Zombie *zombie = NULL;

    std::cout << "Enter name:";
    std::cin >> zombieName;

    zombie = Zombie::newZombie(zombieName);
    randomChump(zombieName);
	if (zombie != NULL)
	{
    	zombie->announce();
    	delete zombie;
	}

    return 0;
}
